import avatarCard from "../images/avatar.gif";

function Info() {
    return (
        <div className="info--card">
            <img
                src={avatarCard}
                alt="Avatar"
                className="info--avatar_icon"
            />
            <h1 className="info--name">Isaac Gomes</h1>
            <h4 className="info--role">Computer Science student</h4>

            <div className="info--contact_buttons">
                <div className="info--email_button">
                    <a href="">Email</a>
                </div>

                <div className="info--linkedin_button">
                    <a href="">LinkedIn</a>
                </div>
            </div>

        </div>
    )
}

export default Info;
